import './App.css';
import React, { useState } from 'react';


function App() {
    const [obj, setObj] = useState({
		prop1: 'value1',
		prop2: 'value2',
		prop3: 'value3',
	});

    const copy = Object.assign({}, obj);
    const result = ((arr) => {
        for (let key in arr) {
          <li>{copy[key]}</li>
        }

    })  




    return <div>
           <ul>
               {result(copy)}
           </ul>
    </div>
}
export default App;
